	(19229, '', '', 'Sayges Horoskop Nr. 1', '', '', '', '', '', NULL, NULL, 'Esst niemals Rind mit einem Tauren.', NULL, NULL, NULL, NULL, NULL),
	(19230, '', '', 'Bestien 2', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(19231, '', '', 'Bestien 3', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
