	(22530, '', '', 'Formel: Armschiene - Erhebliche Verteidigung', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Armschienen dauerhaft zu verzaubern, sodass sie die Verteidigungswertung um 12 erhöhen. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22531, '', '', 'Formel: Armschiene - Überragende Heilung', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Armschienen dauerhaft zu verzaubern, sodass sie die Zaubermacht um 15 erhöhen. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22532, '', '', 'Formel: Armschiene - Mana wiederherstellen', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Armschienen dauerhaft zu verzaubern, sodass sie alle 5 Sek. 6 Mana wiederherstellen. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22533, '', '', 'Formel: Armschiene - Seelenstärke', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Armschienen dauerhaft zu verzaubern, sodass sie die Ausdauer um 12 erhöhen. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22534, '', '', 'Formel: Armschiene - Zaubermacht', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Armschienen dauerhaft zu verzaubern, sodass sie die Zaubermacht um 15 erhöhen. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22535, '', '', 'Formel: Ring - Schlagen', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Ringe dauerhaft zu verzaubern, sodass sie den verursachten körperlichen Schaden um 2 erhöhen. Nur Ringe des Verzauberers können verzaubert werden und sind danach seelengebunden. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22536, '', '', 'Formel: Ring - Zaubermacht', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Ringe dauerhaft zu verzaubern, sodass sie die Zaubermacht um 12 erhöhen. Nur Ringe des Verzauberers können verzaubert werden und sind danach seelengebunden. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22537, '', '', 'Formel: Ring - Heilkraft', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Ringe dauerhaft zu verzaubern, sodass sie die Zaubermacht um 11 erhöhen. Nur Ringe des Verzauberers können verzaubert werden und sind danach seelengebunden. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22538, '', '', 'Formel: Ring - Werte', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Ringe dauerhaft zu verzaubern, sodass sie alle Werte um 4 erhöhen. Nur Ringe des Verzauberers können verzaubert werden und sind danach seelengebunden. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22539, '', '', 'Formel: Schild - Intelligenz', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Schilde dauerhaft zu verzaubern, sodass sie die Intelligenz um 12 erhöhen. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22540, '', '', 'Formel: Schild - Schildblock', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Schilde dauerhaft zu verzaubern, sodass sie die Blockwertung um 15 erhöhen. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22541, '', '', 'Formel: Schild - Widerstand', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Schilde dauerhaft zu verzaubern, sodass sie alle Widerstände um 5 erhöhen. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22542, '', '', 'Formel: Stiefel - Vitalität', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Stiefel dauerhaft zu verzaubern, sodass sie alle 5 Sek. 4 Gesundheit und Mana wiederherstellen. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22543, '', '', 'Formel: Stiefel - Seelenstärke', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Stiefel dauerhaft zu verzaubern, sodass sie die Ausdauer um 12 erhöhen. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22544, '', '', 'Formel: Stiefel - Gewandtheit', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Stiefel dauerhaft zu verzaubern, sodass sie die Beweglichkeit um 12 erhöhen. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22545, '', '', 'Formel: Stiefel - Sicherer Stand', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Stiefel dauerhaft zu verzaubern, sodass sie Trefferwertung sowie kritische Trefferwertung um 10 erhöhen. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22547, '', '', 'Formel: Brust - Außergewöhnliche Werte', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Brustrüstungen dauerhaft zu verzaubern, sodass sie alle Werte um 6 erhöhen. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22548, '', '', 'Formel: Umhang - Erheblicher Widerstand', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Umhänge dauerhaft zu verzaubern, sodass sie alle Widerstände um 7 erhöhen. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22549, '', '', 'Rüstmeisterin Lymels Frachtbrief', '', '', '', '', '', NULL, NULL, 'Das Geschriebene passt kaum auf die Seite. Wer soll bloß all das tragen?', NULL, NULL, NULL, NULL, NULL),
	(22550, '', '', 'Rüstmeisterin Lymels Waren', '', '', '', '', '', NULL, NULL, 'Ihr seid Euch nicht sicher, aber es hörte sich an, als ob im Inneren etwas zerbrochen wäre.', NULL, NULL, NULL, NULL, NULL),
	(22551, '', '', 'Formel: Waffe - Erhebliche Intelligenz', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Nahkampfwaffen dauerhaft zu verzaubern, sodass sie die Intelligenz um 30 erhöhen. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22552, '', '', 'Formel: Waffe - Erhebliches Schlagen', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Nahkampfwaffen dauerhaft zu verzaubern, sodass ihr Schaden um 7 erhöht wird. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22553, '', '', 'Formel: Waffe - Potenz', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Nahkampfwaffen dauerhaft zu verzaubern, sodass sie die Stärke um 20 erhöhen. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22554, '', '', 'Formel: Zweihandwaffe - Unbändigkeit', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Zweihandwaffen dauerhaft zu verzaubern, sodass sie die Angriffskraft um 70 erhöhen. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22555, '', '', 'Formel: Waffe - Erhebliche Zaubermacht', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Nahkampfwaffen dauerhaft zu verzaubern, sodass sie die Zaubermacht um 40 erhöhen. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22556, '', '', 'Formel: Zweihandwaffe - Erhebliche Beweglichkeit', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Zweihandwaffen dauerhaft zu verzaubern, sodass sie die Beweglichkeit um 35 erhöhen. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22557, '', '', 'Formel: Waffe - Meister des Kampfes', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Nahkampfwaffen dauerhaft zu verzaubern, sodass sie manchmal nahe Gruppenmitglieder um 180 bis 300 heilt, wenn ein Nahkampfangriff durchgeführt wird. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22558, '', '', 'Formel: Waffe - Zauberflut', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Nahkampfwaffen dauerhaft zu verzaubern, sodass beim Zauberwirken eine Chance von 3% besteht, im Verlauf von 10 Sek. bei allen Gruppenmitgliedern 100 Mana wiederherzustellen. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22559, '', '', 'Formel: Waffe - Mungo', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Nahkampfwaffen dauerhaft zu verzaubern, sodass sie manchmal die Beweglichkeit um 120 und geringfügig das Angriffstempo erhöhen. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22560, '', '', 'Formel: Waffe - Sonnenfeuer', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Nahkampfwaffen dauerhaft zu verzaubern, sodass sie die Feuer- und Arkanzaubermacht um 50 erhöhen. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
	(22561, '', '', 'Formel: Waffe - Seelenfrost', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Nahkampfwaffen dauerhaft zu verzaubern, sodass sie die Frost- und Schattenzaubermacht um 54 erhöhen. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
