	(28274, '', '', 'Formel: Umhang - Zauberdurchschlagskraft', '', '', '', '', '', NULL, NULL, 'Lehrt Euch, Umhänge dauerhaft zu verzaubern, sodass sie die Zauberdurchschlagskraft um 20 erhöhen. Erfordert einen Gegenstand der Stufe 35 oder höher.', NULL, NULL, NULL, NULL, NULL),
